    <div id="sidebar" className={sidebaropen ? "sidebar-responsive" : ""}>
      <div className="sidebar-title">
        <div className="sidebar-images">
          <img src="" />
          <h1>POS</h1>

          <i
            className="fa fa-times"
            id="sidebarIcon"
            onclick={() => sidebarclosed}
          ></i>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
